import React from "react";
import Game from "../Shop/Game/Game";
import s from "../Shop/Shop.module.css";

const Library = (props) => {
  let state = props.shopPage;
  console.log(props);
  let gamesElements = [
    state.games
      .filter((add) => add.added)
      .map((g) => (
        <Game
          lib="true"
          game={g}
          key={g.id}
          name={g.gameName}
          photo={g.gamePhoto}
          developer={g.developer}
          price={g.gamePrice}
          removeFromLibrary={props.removeFromLibrary}
        />
      )),
  ];

  return (
    <div className={s.shopContent}>
      <div>
        <div className={s.games}>{gamesElements}</div>
      </div>
    </div>
  );
};

export default Library;
